import React, { Component, useState } from 'react'
import Header from './Header'
import { Table } from 'react-bootstrap';
import Axios from 'axios';
import { useEffect } from 'react';

export default function Users() {
  const [users, setUser] = useState([]);

  useEffect(() => {
    Axios.get('/users')
      .then(({ data }) => {
        setUser(data.data)
      });
  }, [])

  return (
    <Header title='Users list'>

      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Username</th>
          </tr>
        </thead>

        <tbody>


        </tbody>
      </Table>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Surname</th>
            <th>Age</th>
            <th>email</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => {
            return <tr key={user.id} >
              <td>{user.id}</td>
              <td>{user.name}</td>
              <td>{user.surname}</td>
              <td>{user.age}</td>
              <td>{user.email}</td>
            </tr>
          })}

        </tbody>
      </Table>
    </Header>
  )
}
